import axios from 'axios'
import React, { Component } from 'react'

export default class App extends Component {

    getStudent = () => {
        axios.get("").then(
            response => { console.log('success', response.data); }
        )
    }

    render() {
        return (
            <div>
                <button onClick={this.getStudent}>
                    click me
                </button>
            </div>
        )
    }
}
